import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <h1>SkillBoost</h1>
      <p>Transform Your Career with Our Cutting-Edge Online Courses</p>
      <button className="cta-button">Get Started for Free</button>
    </header>
  );
};

export default Header;
